From DistroWatch :
MeeGo is an open-source Linux project which brings together Moblin headed up by Intel, and Maemo by Nokia, into a single open-source activity targeting netbooks and other mobile devices. MeeGo for IVI (In-Vehicle Infotainment) Version 1.0 was just announced: &quot;We are pleased to present this 1.0 release of MeeGo for IVI. As part of this release, we are including a sample IVI home screen and taskbar, using the included Qt framework, and designed with Automotive Center Console HMI requirements in mind. We have also included some automotive specific middleware components and a few sample applications, including sample navigation program (Navit) and a sample dialer application (BT-HFP Dialer) which uses Bluetooth and a paired phone....&quot; 
